create table if not exists SUPPLIER(  S_SUPPKEY string,  S_NAME string,  S_ADDRESS string,  S_NATIONKEY string,  S_PHONE string,  S_ACCTBAL double,  S_COMMENT string)stored as parquet tblproperties("parquet.compression"="snappy")
create table if not exists PARTSUPP (  PS_PARTKEY string,  PS_SUPPKEY  string,  PS_AVAILQTY  int,  PS_SUPPLYCOST  double,  PS_COMMENT  string)stored as parquet tblproperties("parquet.compression"="snappy")
create table if not exists CUSTOMER(  c_mktsegment string,  C_CUSTKEY string,  C_NAME string,  C_ADDRESS string,  C_NATIONKEY string,  C_PHONE string,  C_ACCTBAL double,  C_COMMENT string)stored as parquet tblproperties("parquet.compression"="snappy")
create table if not exists NATION ( n_name string, N_NATIONKEY string,  N_REGIONKEY string,  N_COMMENT  string) stored as parquet tblproperties("parquet.compression"="snappy")
create table if not exists REGION(r_name string,  R_REGIONKEY string,  R_COMMENT string) stored as parquet tblproperties("parquet.compression"="snappy")
create table if not exists PART(  P_BRAND string,  P_PARTKEY string,  P_NAME string,  P_MFGR string,  P_TYPE string,  P_SIZE int,  P_CONTAINER string,  P_RETAILPRICE double,  P_COMMENT string)stored as parquet tblproperties("parquet.compression"="snappy")
create table if not exists lineitem(  L_SHIPDATE date,  L_ORDERKEY string,  L_PARTKEY string,  L_SUPPKEY   string,  L_LINENUMBER int,  L_QUANTITY double,  L_EXTENDEDPRICE double,  L_DISCOUNT double,  L_TAX double,  L_RETURNFLAG string,  L_LINESTATUS string,  L_COMMITDATE date,  L_RECEIPTDATE date,  L_SHIPINSTRUCT string,  L_SHIPMODE string,  L_COMMENT  string) stored as parquet tblproperties("parquet.compression"="snappy")
create table if not exists ORDERS(  O_ORDERDATE date,  O_ORDERKEY string,  O_CUSTKEY string,  O_ORDERSTATUS string,  O_TOTALPRICE double,  O_ORDERPRIORITY string,  O_CLERK string,  O_SHIPPRIORITY int,  O_COMMENT  string)stored as parquet tblproperties("parquet.compression"="snappy")